import React from "react";
import data from "../../data/movie_crew";

const { cast } = data;

export const Cast = () => {
  return (
    <div className="">
      <h1 className="content-header">Cast</h1>
      <div className="grid grid-cols-1 sm:grid-cols-2">
        {cast.map((actor) => {
          const { id, name, character, profile_path } = actor;
          return (
            <div key={id} className="border flex">
              <div className="w-20 rounded-full overflow-hidden">
                <img
                  src={`https://image.tmdb.org/t/p/w500${profile_path}`}
                  alt="Cast"
                />
              </div>
              <div className="p-5">
                <h1>{name}</h1>
                <p>{character}</p>
              </div>
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default Cast;
